import React from 'react';

class Body extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: "risa",
        }
    }
    render(){
        return(
            <div>
                <div class="title"></div>
                <div class="questions"></div>

                {this.state.name}
            </div>
        );
    }
}

export default Body;
